	add("brood", "{\"term\":\"brood\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"low german\", \"Dutch\", \"scots\"], \"text\":\"From Middle english (1100-1500) \u0027brood\u0027 \u0027brod\u0027 from Old english (ca. 450-1100) {{m|ang|brōd||brood; foetus; breeding, hatching}}, from Proto-germanic {{m|gem-pro|*brōduz||heat, breeding}}, from Proto-indo-european {{m|ine-pro|*bʰrē-||breath, mist, vapour, steam}}. Cognate with Scots \u0027brude\u0027 \u0027brod\u0027 (brood, child, offspring) Dutch \u0027broed\u0027 (spawn) Low german \u0027broot\u0027 (spawn, breeding, incubation, brood) German \u0027brut\u0027 (breeding, progeny, incubation, brood)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The young of certain animals, especially a group of young birds or fowl hatched at one time by the same mother\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bible, Luke xiii. 3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As a hen doth gather her \u0027\u0027brood\u0027\u0027 under her wings\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The young of any lay an egg-laying creature, especially if produced at the same time\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The eggs and larvae of social insects such as bees, ants and some wasps, \u0027especially\u0027 when gathered together in special brood chambers or combs within the colony\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The children in one family\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"That which is bred or produced; breed; species\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Chapma\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Flocks of the airy \u0027\u0027brood\u0027\u0027, / (Cranes, geese or long-necked swans\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Heavy waste in tin and copper ores\", \"priority\":10}]}, \"synonyms\":{}}");

	add("broody", "{\"term\":\"broody\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|*brody}}, {{m|enm|*brodi}}, from Old english (ca. 450-1100) {{m|ang|brōdiġ||broody}}, equivalent to {{suffix|brood|y|lang\u003den}}. Cognate with German \u0027brütig\u0027 (broody)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Poultry) A female bird which is in the condition to incubate eggs; a broody hen, duck, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"There are six \u0027\u0027broodies\u0027\u0027 in that coop\", \"priority\":2}]}, \"synonyms\":{}}");

