	add("brotherhood", "{\"term\":\"brotherhood\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027brotherhod\u0027 from earlier \u0027brotherhede\u0027 alteration (influenced by suffixes in \u0027-hood\u0027 \u0027-head\u0027 of Early Middle english (1100-1500) \u0027brotherrede\u0027 (brotherhood, fraternity) from Old english (ca. 450-1100) {{m|ang|brōþorrǣden||brotherhood, fellowship}}, equivalent to {{suffix|brother|red|lang\u003den}} (see {{l/en|brotherred}}). More at brother, -red.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being brothers or a brother\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An association for any purpose, as a society of monks; a fraternity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The whole body of persons engaged in the same business, -- especially those of the same profession; as, the legal or medical brotherhood\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Persons, and, poetically, things, of a like kind\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027brotherhood\u0027\u0027 of venerable trees.\u0027 - w:William William Wordsworth\", \"priority\":5}]}, \"synonyms\":{}}");

