	add("brotherman", "{\"term\":\"brotherman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|brother|man|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Odie Hawkins, \u0027Busting Out of an Ordinary Man\u0027 (page 129\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Action, \u0027\u0027brotherman\u0027\u0027! Action is what we need! Direct, coldblooded action\", \"priority\":3}]}, \"synonyms\":{}}");

	add("brotus", "{\"term\":\"brotus\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"Spanish\", \"ancient greek (to 1453)\", \"jamaican creole english\", \"Kongo\", \"Portuguese\"], \"text\":\"Mitford Mathews suggested in 1951 that the term derived from {{m|en||brot|scrap(s), small amount(s)}},\u0026lt;ref name\u003d\u0026quot;Cassidy\u0026quot;\u0026gt;F. G. Cassidy, \u0027Etymology in Caribbean Creoles\u0027, in \u0027Focus on the Caribbean\u0027 (ISBN 9027248664), which quotes Mathew\u0027s \u0027Dictionary of Americanisms\u0027 (1951)\u0026lt;/ref\u0026gt; a northern England dialectal term ultimately derived from Old english (ca. 450-1100) {{m|ang|brēotan}},\u0026lt;ref\u0026gt;\u0027The English Dialect Dictionary\u0027 (1898)\u0026lt;/ref\u0026gt; but Frederic Cassidy notes that this has \u0026quot;no connection to the marketing context\u0026quot;\u0026lt;ref name\u003d\u0026quot;Cassidy\u0026quot;/\u0026gt; and Joey Lee Dillard finds the idea \u0026quot;unconvincing\u0026quot;.\u0026lt;ref\u0026gt;Joey Lee Dillard, \u0027Toward a Social History of American English\u0027\u0026lt;/ref\u0026gt; Cassidy mentions that the term might be related to Jamaican creole english {{m|jam|braata||little extra given by a seller to a buyer}}, though he considers this \u0026quot;questionable\u0026quot; because \u0026quot;the stressed vowel is rather different [...] and the final \u0027-us\u0027 of the American form would have to be accounted for\u0026quot;; the Jamaican term might derive from a Spanish cognate of Portuguese {{m|pt|barato||favour}}.\u0026lt;ref name\u003d\u0026quot;Cassidy\u0026quot;/\u0026gt; An African origin has also been suggested, but not substantiated; \u0027The African Heritage of American English\u0027 for example suggests derivation from an African word \u0027mbata\u0027 meaning \u0026quot;something given on credit, without payment\u0026quot;, but Kongo {{m|kg|mbata}} in fact means \u0026quot;perquisite, commission, brokerage\u0026quot;.\u0026lt;ref\u0026gt;W. Holman Bentley, \u0027Dictionary and Grammar of the Kongo Language\u0027 (1887)\u0026lt;/ref\u0026gt;\u0026lt;!--Alternatively, possibly from Ancient greek (to 1453) \u0027βρωτός\u0027 (lang\u003dgrc) -- Says who?--\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something added at no extra charge, such as the thirteenth item in a baker\u0027s dozen\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brouhaha", "{\"term\":\"brouhaha\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hebrew\"], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027brouhaha\u0027 but disputed as to where from before that. Possibly from Hebrew \u0027sc\u003dhebr|lang\u003dhe|בָּרוּךְ הַבָּא|tr\u003dbarúkh habá\u0027 (welcome)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stir; a fuss or uproar\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It caused quite a \u0027\u0027brouhaha\u0027\u0027 when the school suspended one of its top students for refusing to adhere to the dress code\", \"priority\":2}]}, \"synonyms\":{}}");

	add("brouter", "{\"term\":\"brouter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|bridge|router|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A network device that acts as both a bridge and a router by routing packets for known protocols and forwarding all others, as a bridge would\", \"priority\":1}]}, \"synonyms\":{}}");

	add("browband", "{\"term\":\"browband\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|brow|band|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Part of a horse\u0027s bridle that runs from just under one ear, across the forehead, to just under the other ear, preventing the bridle from sliding down\", \"priority\":1}]}, \"synonyms\":{}}");

	add("browis", "{\"term\":\"browis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Old french (842-ca. 1400) \u0027broez\u0027, \u0027brouez\u0027, \u0027brouets\u0027 plural of \u0027broet\u0027, \u0027brouet\u0027 (French \u0027brouet\u0027 ‘gruel’), from \u0027breu\u0027, from \u0027*brodittum\u0027, a diminutive of vulgar Latin \u0027*brodum\u0027, from Germanic \u0027*brod\u0027 ‘sauce’ (English broth).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"brewis\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brownback", "{\"term\":\"brownback\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|brown|back|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bird, the dowitcher or red-breasted snipe.Category:en:Shorebirds\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brownface", "{\"term\":\"brownface\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|brown|face|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A style of theatrical makeup in which a white person colours the face brown in order to represent somebody of another race\", \"priority\":1}]}, \"synonyms\":{}}");

	add("brownie", "{\"term\":\"brownie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From the story \u0026quot;The Brownies\u0026quot; by w:Juliana Horatia Ewing|Juliana Horatia Ewing, written in 1870. In the story two children, Tommy and Betty, learn that children can be helpful brownies or lazy boggarts.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A junior Girl Guide\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027 July 14, \u0027Boot by a Brash \u0027\u0027Brownie\u0027\u0027\u0027, \u0027w:Life LIFE, %22brownies%22+guides+-intitle:%22brownie|brownies%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dqjEMT-nYHcagiQfUv-SQBg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22brownies%22%20guides%20-intitle%3A%22brownie|brownies%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 124\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In Toronto young \u0027\u0027Brownies\u0027\u0027 of the Girl Guides, the Canadian girl scouts, stood in parade formation with full-fledged Guides\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Doug Owram, \u0027Born at the Right Time: A History of the Baby-Boom Generation\u0027, %22brownies%22+guides+-intitle:%22brownie|brownies%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dqjEMT-nYHcagiQfUv-SQBg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22brownies%22%20guides%20-intitle%3A%22brownie|brownies%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 102\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The ideal \u0027\u0027Brownie\u0027\u0027 pack, according to the 1960 \u0027Guide Commissioner′s Handbook\u0027, would contain \u0027\u0027Brownies\u0027\u0027 who were ‘alert, clean, tidy and punctual. Their uniform should be correct\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Tammy M. Proctor, \u0027Scouting for Girls: A Century of Girl Guides and Girl Scouts\u0027, %22brownies%22+guides+-intitle:%22brownie|brownies%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dsi0MT5HSCaaXiAf7xv30BQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22brownies%22%20guides%20-intitle%3A%22brownie|brownies%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 85\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Another Guide group that persevered through internment was the 1st Chefoo (which had \u0027\u0027Brownies\u0027\u0027, Guides and Rangers) in Shandong province, China.The November 2, 1942, entry in the \u0027\u0027Brownie\u0027\u0027 logbook pleads for cheerfulness in the face of adversity: “We are in need of smiles. Have you got them ready, \u0027\u0027Brownies\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A junior Girl Scout\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1952\u0027\u0027 March 24, \u0027Girl Scouts: They Are Observing Their 40th Birthday\u0027, w:Life LIFE, %22brownies%22+scouts+-intitle:%22brownie|brownies%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnTYMT8mbJKOriAfTjJ3rBQ\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"%22brownies%22%20scouts%20-intitle%3A%22brownie|brownies%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 109\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Any girl willing to follow the simple rules can join the Girl Scouts. As \u0027\u0027Brownies\u0027\u0027 they will spend most of their time playing games and singing songs like the \u0027\u0027Brownie\u0027\u0027 Smile Song: “I′ve something in my pocket; It belongs across my face, And I keep it very close at hand In a most convenient place.... I′m sure you couldn′t guess it If you guessed a long, long while, So I′ll take it out and put it on—It′s a great big \u0027\u0027Brownie\u0027\u0027 smile\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Samuel F. Pickering, \u0027The Blue Caterpillar\u0027, in \u0027The Blue Caterpillar and Other Essays\u0027, %22brownies%22+scouts+-intitle:%22brownie|brownies%22+-inauthor:%22%22+-guide+-guides\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003drz8MT4ulHKyZiQfBpMCVBg\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"%22brownies%22%20scouts%20-intitle%3A%22brownie|brownies%22%20-inauthor%3A%22%22%20-guide%20-guides\u0026amp;f\u003dfalse page 63\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Most marchers were children, Girl and Boy Scouts, Cub Scouts and \u0027\u0027Brownies\u0027\u0027. One Cub Scout pulled his sister in a Radio Flyer decorated with small American flags. A \u0027\u0027Brownie\u0027\u0027 pushed a baby carriage crammed with a zoo of stuffed animals\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Kim Perone, \u0027Vacuum Like No One Is Watching\u0027, %22brownies%22+scouts+-intitle:%22brownie|brownies%22+-inauthor:%22%22+-guide+-guides\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003drz8MT4ulHKyZiQfBpMCVBg\u0026amp;redir_esc\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"%22brownies%22%20scouts%20-intitle%3A%22brownie|brownies%22%20-inauthor%3A%22%22%20-guide%20-guides\u0026amp;f\u003dfalse page 15\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"After all, the meetings were held at my \u0027own\u0027 house and my \u0027own\u0027 mother was the queen. Doesn′t that make me some sort of \u0027\u0027Brownie\u0027\u0027 princess? Apparently not\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"As we graduated from \u0027\u0027Brownies\u0027\u0027 to Girl Scouts, Mom was again my leader\", \"priority\":21}]}, \"synonyms\":{}}");

	add("brownout", "{\"term\":\"brownout\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|brown|out|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A period of low alternating current line voltage, causing a reduction in illuminatio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"When demand for electricity exceeds the available supply, a \u0027\u0027brownout\u0027\u0027 occurs\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Temporary dimming of vision, usually with a brown hue and accompanied by loss of peripheral vision or tunnel vision\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"On rising suddenly from her chair she experienced a \u0027\u0027brownout\u0027\u0027 and had to sit down again quickly\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Temporary closing of a fire station, usually due to budget restrictions\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Fire departments across the country have been forced to rely on rolling \u0027\u0027brownouts\u0027\u0027 because of the recession\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a power outage during the day; distinguished from a blackout, which occurs at night\", \"priority\":7}]}, \"synonyms\":{}}");

	add("brownwort", "{\"term\":\"brownwort\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|brown|wort|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A species of figwort or \u0027Scrophularia\u0027, (), and other species of the same genus, mostly perennials with inconspicuous coarse flowers\", \"priority\":1}]}, \"synonyms\":{}}");

